import React from "react";
import NavBar from "../components/layout/Navbar";
import './home.css';

const Home = () => {
  return (
    <div>
      <NavBar />
      <div class="hero">
            <h1>Welcome to Our Blog</h1>
        </div>
     <div className="container">
        <div className="filter">
            <button className="category-btn active" data-category="all">All</button>
            <button className="category-btn" data-category="tech">Tech</button>
            <button className="category-btn" data-category="fashion">Fashion</button>
            <button className="category-btn" data-category="travel">Travel</button>
        </div>
     </div> 


    </div>
  );
};

export default Home;
